import React from 'react';
import Sdata from './Sdata'
import web from "../src/img/cupcake-2.jpeg"
import Card from './Card'
const Service=()=>{
    return (
        <>
      <div className="my-5">
     
      </div>
      <div className="container-fluid mb-5">
          <div className="row">
          <div className="col-10 mx-auto">
              <div className="row gy-4">

              {Sdata.map((val,index)=>{
                  return <Card
                  key={index}
                      imgsrc={val.imgsrc}
                      title={val.title}
                  />
              })}
        </div>
          </div>
          </div>
      </div>
       </>
    )
    }
export default Service
